import Card from './Card'
function Lista({ data }){
    return(
        <>
       {data.map((item, index)=>(
            <Card
                nome_site={item.id}
                desc_site={item.body_text}
                link_site={item.a_link}
                link_img={item}
            />
       ))}
        </>
    )
}

export default Lista

